import dados from '../dados/dadosClientes.json'

function lista() {
   return (
      <div>{dados.map((item) => (console.log(item.nomeCliente,item.numeroCliente,item.usinas[0].percentualDeParticipacao)))}</div>
   )
}
export default lista;
